import React from "react";

const BooksTable = ({ books }) => {
  return (
    <React.Fragment>
      <h1>Books</h1>
      <table className="table table-hover">
        <thead>
          <tr>
            <th>Title</th>
            <th>Author</th>
            <th>Genre</th>
            <th>Rate</th>
          </tr>
        </thead>
        <tbody>
          {books.map((book, ind) => {
            return (
              <tr key={ind}>
                <td>{book.title}</td>
                <td>{`${book.author_first_name} ${book.author_second_name}`}</td>
                <td>{book.genre}</td>
                <td>{book.rate}</td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </React.Fragment>
  );
};

export default BooksTable;
